import React, { useState } from 'react';

const AIGenerate = () => {
  const [response, setResponse] = useState('');

  const handleButtonClick = async () => {
    try {
      const apiResponse = await fetch('YOUR_BACKEND_API_URL');
      const data = await apiResponse.json();
      setResponse(data.message); // Assuming your API returns an object with a "message" property
    } catch (error) {
      console.error('Error fetching data:', error);
      setResponse('Error fetching data from the API.');
    }
  };

  return (
    <div>
        <div className='programs-header'>
        <h1 className='Header'>
          Or let AI generate it for you
          </h1>
        </div>
      <button onClick={handleButtonClick}>Generate AI</button>
      <p>API Response: {response}</p>
    </div>
  );
};

export default AIGenerate;
